import React from 'react'

type apiArray = {
  id: number;
  title: string;
  price: number;
  image: string;
};

function CartItem({id,image, price, title}:apiArray) {
  return (
    <div>
      <div>{id}</div>
      <img src={image} alt="" />
      <div>{price}</div>
      <div>{title}</div>
    </div>
  )
}

export default CartItem
